import React from 'react'
import { BrowserRouter, Route } from "react-router-dom";
// import NINE from "./nl_logo.png";
// import { Link } from "react-router-dom";
import LogMainbody from "./loginpg/logMainbody";

import WelMainbody from "./welcompg/welMainbody";
import Managerpage1 from "./Pages/Listofreportees";

import Managerpage3 from "./Pages/Feedback";
import Managerpage4 from "./Pages/Goals"

import Managermain5 from "./Managerpg5/Managermain5";

import Empmain1 from "./employee/emppg1"

import Empmain2 from "./employee/emppg2"
import Empmain3 from "./employee/emppg3"
import Empmain4 from "./employee/emppg4"

import HrMainPage from "./hr/HrMainPage"
import Employeepage1 from "./Pages/FeedbackandGoals"
import Login from "./Pages/Login"

class App extends React.Component {
  constructor() {
    super();
  };

  render() {
    return (
      <BrowserRouter>
        <div>
          <header>
            <div>
              <Route exact path="/" component={WelMainbody} />
              <Route exact path="/login" component={Login} />
              {/* <Route exact path="/signup" component={SignupMainbody}/> */}
              <Route exact path="/manager/:mid/" component={Managerpage1} />
              {/* <Route exact path={"/month/:mid/:id/:emp/:pro"} component={Managerpage2}/> */}
              <Route exact path={"/static-form/:mid/:id/:emp/:pro"} component={Managerpage3} />
              <Route exact path={"/dynamic-form/:mid/:id/:emp/:pro"} component={Managerpage4} />
              <Route exact path="/logout" component={LogMainbody} />
              <Route exact path={"/goals/:mid/:id/:month/:emp/:pro"} component={Managermain5} />


              <Route exact path={"/e/:id"} component={Employeepage1} />
              <Route exact path={"/e"} component={Empmain1} />
              <Route exact path={"/em-month/:id/:emp"} component={Empmain2} />
              <Route exact path={"/month-feedback/:id/:emp/:month"} component={Empmain3} />
              <Route exact path={"/logout"} component={Empmain1} />
              <Route exact path={"/em-goals/:id/:emp/:month"} component={Empmain4} />
              <Route exact path={"/hr/:id"} component={HrMainPage} />




              {/* <Route exact path ={"/em-month"} component={Empmain2}/> */}

              {/* <Route exact  path={"/hr"} component={HrMainPage}/> */}
              {/* <Route exact path ={"/em"} component={Empmain2}/> */}



            </div>
          </header>




        </div>
      </BrowserRouter>




      //  <BrowserRouter>
      //  <Route exact path="/e" component={Empmain1}/>
      //  <Route path ="/em-month" component={Empmain2}/>
      //  <Route path ="/month-feedback" component={Empmain3}/>
      //  <Route path ="/employee" component={Empmain1}/>
      //  <Route path ="/em-goals" component={Empmain4}/>
      //   </BrowserRouter>


      //  <Empmain4/>




    );
  }
}

export default App;
